import background from './Images/background.jpg'
function Home() {
  return (
      <div >
       <div style={{backgroundImage:`url(${background})`,backgroundRepeat:"no-repeat",backgroundSize:"cover",height:"100vh",width:"100%"}}>
        <div style={{backgroundColor:"#000",backgroundRepeat:"no-repeat",backgroundSize:"cover",height:"100vh",width:"100%",opacity:"0.7"}}></div>
       </div>
      </div>
  )
}

export default Home
